@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {
}
<ul class="list-group">
  <li class="list-group-item">

    Cras justo odio
    <i class="bi bi-trash m-auto"></i>

  </li>
  <li class="list-group-item">Dapibus ac facilisis in</li>
